const CustomInput = ({ key, value }) => {
  return <div>
    <div>text</div>
    <input
      type="text"
      value={key}
    />
  </div>
}

export const Config = () => {
  console.log(window.config)
  return <div>
    {Object.entries(window.config).map((key, value) => {
      return <CustomInput
        text={key}
        value={value}
      />
    })}
  </div>
}
